import React from "react";

const Monday = () => {
  return (
    <div
      style={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        height: "90vh",
      }}
    >
      <h1>Monday</h1>
    </div>
  );
};

export default Monday;
